• Valor Futuro: VF (tasa, nper, pgto, vp, tipo)
Tasa: Es la tasa de interés por período;
Nper: Es el número total de pagos;
Pgto: Es el pago hecho a cada período. En general este argumento está compuesto por el capital y los jutos, cuando es omitido se vuelve obligatorio incluir el argumento vp;
Vp: Es el valor presente, es decir, la suma total correspondiente al valor presente de una serie de pagos futuros. Cuando este argumento es omitido lo mismo es considerado 0 y la inclusión del argumento pgto en este caso será obligatoria;
tipo: Siempre siendo el número 1 o 0 este argumento indica las fechas de vencimiento de los pagos siendo 0 el final del período y 1 el inicio del período.












